import React, { useState } from "react";
import DownloaderForm from "./components/DownloaderForm";
import FAQ from "./components/FAQ";
import "./App.css";
import logo from " ./frontend/public/logo.svg"; // CRA will copy from public
<img src="/logo.svg" alt="Logo" />


const TABS = [
  { id: "instagram", label: "Instagram" },
  { id: "youtube", label: "YouTube" },
];

const IG_TYPES = [
  { id: "auto", label: "All (Reels/Posts/IGTV)" },
  { id: "reel", label: "Reels" },
  { id: "post", label: "Post (Photo/Video)" },
  { id: "igtv", label: "IGTV" },
  { id: "carousel", label: "Carousel (first item only)" },
];

const YT_TYPES = [
  { id: "auto", label: "All (Shorts/Live/Long)" },
  { id: "shorts", label: "Shorts" },
  { id: "live", label: "Live (if available)" },
  { id: "long", label: "Long Video" },
];

export default function App() {
  const [platform, setPlatform] = useState("instagram");
  const [igType, setIgType] = useState("auto");
  const [ytType, setYtType] = useState("auto");

  return (
    <div className="app">
      <header className="nav">
        <div className="brand">
          <img src={logo} className="logo" alt="InstantSaver" />
          <span>InstantSaver</span>
        </div>
        <nav className="links">
          <a href="#features">Features</a>
          <a href="#faq">FAQ</a>
          <a href="mailto:hello@instantsaver.app">Contact</a>
        </nav>
      </header>

      <section className="hero">
        <h1>Online Video Downloader</h1>
        <p>Download Instagram Reels/Posts & YouTube Shorts/Live/Long — fast, free, no login.</p>
        <div className="tabs">
          {TABS.map(t => (
            <button
              key={t.id}
              className={`tab ${platform === t.id ? "active" : ""}`}
              onClick={() => setPlatform(t.id)}
            >
              {t.label}
            </button>
          ))}
        </div>

        {platform === "instagram" && (
          <div className="subtabs">
            {IG_TYPES.map(t => (
              <button
                key={t.id}
                className={`subtab ${igType === t.id ? "active" : ""}`}
                onClick={() => setIgType(t.id)}
              >
                {t.label}
              </button>
            ))}
          </div>
        )}

        {platform === "youtube" && (
          <div className="subtabs">
            {YT_TYPES.map(t => (
              <button
                key={t.id}
                className={`subtab ${ytType === t.id ? "active" : ""}`}
                onClick={() => setYtType(t.id)}
              >
                {t.label}
              </button>
            ))}
          </div>
        )}

        <DownloaderForm platform={platform} igType={igType} ytType={ytType} />
      </section>

      <section id="features" className="features">
        <h2>Everything in one place</h2>
        <div className="feature-grid">
          <div className="card">
            <h3>Fast & Smart</h3>
            <p>High-speed processing backed by optimized pipelines to preview & download instantly.</p>
          </div>
          <div className="card">
            <h3>Free to Use</h3>
            <p>No signup. No paywall. Just paste your link, preview, and download.</p>
          </div>
          <div className="card">
            <h3>Unlimited</h3>
            <p>Use it as much as you like. No hidden limits.</p>
          </div>
        </div>
      </section>

      <FAQ />

      <footer className="footer">
        <div className="footer-brand">
          <img src={logo} className="logo small" alt="InstantSaver" />
          <strong>InstantSaver</strong>
        </div>
        <p>© {new Date().getFullYear()} InstantSaver. All rights reserved.</p>
        <p className="disclaimer">
          Disclaimer: All logos and trademarks belong to their respective owners. We do not host any copyrighted content; downloads are fetched directly from public CDNs where available. Please respect platform terms and copyrights.
        </p>
      </footer>
    </div>
  );
}
